В одном из престижных жилых комплексов, по проспекту Г. Джавида, около метро Элмляр Академиясы Предлагается на продажу роскошная 3х комнатная квартира без отделки - ПОД МАЯК, без ремонта, а значит, вы сможете предусмотреть каждую мелочь для удобства.
Общая площадь составляет 177 кв.м. Квартира СКВОЗНАЯ. 18/4 этаж.
Супер проект с отличной планировкой.ВЫ ДЕЛАЕТЕ РЕМОНТ И ОБСТАНОВКУ ИНДИВИДУАЛЬНО ПОД СЕБЯ. Элитная отделка фасадa. Панорамные витражи. В комплексе современными коммуникации, централизованная отопительная система, 2-х этажный подземный гараж, 24 часовая охрана, круглосуточная подача горячей и холодной воды, 3 скоростных бесшумных лифта «Mitsubishi», мраморные блоки. Близкое расположение к парку и зелени .Освещение всей территории Сейфовые двери с контролем доступа.Домофон.

. На территории имеется:
